import Carte from "./Carte"

class Plateau 
{

    constructor()
    {
        this.cartes = this.initCartes();
        console.log(this.cartes);
    }


    initCartes()
    {
        let tempTabCartes = [];
        let nbCartes = 0;

        for(let i = 0 ; i < 52 ; i+=4)
        {
            for(let j = 0 ; j < 13 ; j++)
            {
                tempTabCartes.push(new Carte(tempTabCartes.length, "Coeur", false));
                tempTabCartes.push(new Carte(tempTabCartes.length-1, "Trefle", false));
                tempTabCartes.push(new Carte(tempTabCartes.length-2, "Pique", false));
                tempTabCartes.push(new Carte(tempTabCartes.length-3, "Carreau", false));
            }
        }

        return tempTabCartes;
    }

}

function PlateauComposant()
{
    let plateau = new Plateau;


    return (
        <div>
            <p></p>
        </div>    
    )
}


export { Plateau };
export default PlateauComposant;
